import React , { useState }  from 'react';


export default function SignUp()
{
    const [email, setEmail] = useState("");
    const [password, setPassword] = useState("");
    const [confirmPassword, setConfirmPassword] = useState("");

    const [newUser, setNewUser] = useState(null);
    function validateForm() {
        return (
          email.length > 0 &&
          password.length > 0 &&
          password === confirmPassword
        );
    }
    function handleSubmit(event) {
        event.preventDefault();

        setNewUser("test");

    }

    return (
    <div className ="container">
        <div className ="row justify-content-center">
            <div className="card m-4">
                <form>
                <input 
                autoFocus
                type="email"
                value={email}
                onChange={e => setEmail(e.target.value)}>Email</input>
                <input 
                type='password'
                value={password}
                onChange={e => setPassword(e.target.value)} >password</input>

                <input 
                type='password' 
                value={confirmPassword}
                onChange={e => setConfirmPassword(e.target.value)} >confirm password</input>
                <button className="btn" disabled={!validateForm()} onSubmit={handleSubmit}>Signin</button>
                </form>
            </div>
        </div>
    </div>
    )
}
